import logo from './logo.svg';
import './App.css';
import { todoList } from './store/mock-items';

function App() {
  return (
    <div className="App">
        {todoList.map((item) => (
          <div key={item.id}>
            {item.text}
          </div>

        ))}
    </div>
  );
}

export default App;
